CREATE DEFINER=`user`@`%` PROCEDURE `getStocksAvailableByUser`(
IN userId VARCHAR(255)
)
BEGIN

DECLARE tNameStep1 NVARCHAR(255);
DECLARE tNameStep2 NVARCHAR(255);
DECLARE tNameStep3 NVARCHAR(255);
select uuid() into tNameStep1;
create 
TEMPORARY
 TABLE tNameStep1
 ENGINE=MEMORY 
select 
	c.id,
    s.lot_number,
	c.name  , 
    c.code,
    DATE_FORMAT(s.trans_date,"%Y-%m-%d") as trans_date,
	sum(s.stock_in)-sum(s.out_stock) as stock ,
	s.price,
	commission_rate,
    c.price as cprice
 FROM stock_ledger s
 inner join companies c ON s.company=c.id
 where s.user_id= userId
group by s.company , s.lot_number
having stock > 0;


select uuid() into tNameStep2;
create 
TEMPORARY
 TABLE tNameStep2
 ENGINE=MEMORY 
  select 
  id, 
  lot_number, 
  name,
  code,
  trans_date,
  stock,
  price,
  commission_rate,
  (stock * price) as amount,
  ((stock * price) / 100) * commission_rate commission,
  (stock * price) + ((stock * price) / 100) * commission_rate as netAmount,
  cprice as currentPrice
  from tNameStep1;
 
 
select uuid() into tNameStep3;
create 
TEMPORARY
 TABLE tNameStep3
 ENGINE=MEMORY 
 select id, 
  lot_number, 
  name,
  code,
  trans_date,
  stock,
  price,
  commission_rate,
  amount,
  commission,
  netAmount,
  (netAmount/stock) as avg_price,
  currentPrice
  from tNameStep2;
 

  select 
  tNameStep3.id,
  name as company,
  code,
   max(trans_date) as date,
  sum(stock) as qty,
  sum(amount) / sum(stock) as price ,
  sum(netAmount) / sum(stock) as avg_price,
  sum(netAmount) as amount,
  sum(commission) as chargers,
  group_concat(lot_number) as lot_numbers,
  currentPrice as current_price,
   (sum(stock) * currentPrice) - sum(netAmount)  - ((sum(stock) * currentPrice)/100 * cm.commission_amount)   as   unrealize_profit,
   getProfitMargine((sum(stock) * currentPrice) - sum(netAmount)  - ((sum(stock) * currentPrice)/100 * cm.commission_amount),sum(netAmount)) as percentage,
   cm.commission_amount as commission
  from tNameStep3 join commission cm
  GROUP BY tNameStep3.id
  ;

  
 drop table tNameStep1;
 drop table tNameStep2;
 drop table tNameStep3;
END ;;
DELIMITER ;
