CREATE DEFINER=`user`@`%` PROCEDURE `getTotalEarningsByUser`(IN userId VARCHAR(255))
BEGIN
 declare totalProfit decimal(18,4);
  declare currentMonthEarnings decimal(18,4);
    declare todayEarnings decimal(18,4);
DECLARE tNameStep1 NVARCHAR(255);
DECLARE tNameStep2 NVARCHAR(255);
DECLARE tNameStep3 NVARCHAR(255);
select uuid() into tNameStep1;
create 
TEMPORARY
 TABLE tNameStep1
 ENGINE=MEMORY 
select 
	c.id,
    s.lot_number,
	c.name  , 
    DATE_FORMAT(s.trans_date,"%Y-%m-%d") as trans_date,
	sum(s.stock_in)-sum(s.out_stock) as stock ,
	s.price,
	commission_rate
 FROM stock_ledger s
 inner join companies c ON s.company=c.id
 where s.user_id= userId
group by s.company , s.lot_number
having stock > 0;


select uuid() into tNameStep2;
create 
TEMPORARY
 TABLE tNameStep2
 ENGINE=MEMORY 
  select 
  id, 
  lot_number, 
  name,
  trans_date,
  stock,
  price,
  commission_rate,
  (stock * price) as amount,
  ((stock * price) / 100) * commission_rate commission,
  (stock * price) + ((stock * price) / 100) * commission_rate as netAmount
  from tNameStep1;
 
 
select uuid() into tNameStep3;
create 
TEMPORARY
 TABLE tNameStep3
 ENGINE=MEMORY 
 select id, 
  lot_number, 
  name,
  trans_date,
  stock,
  price,
  commission_rate,
  amount,
  commission,
  netAmount,
  (netAmount/stock) as avg_price
  from tNameStep2;
 

 
SELECT 
sum((s.net_amount - (select (st.net_amount / st.stock_in) * s.out_stock  buy_net_amount from stock_ledger st  where st.trans_type !='SALE' and st.lot_number= s.lot_number))) into totalProfit
 FROM stock_ledger s 
inner join  companies c ON s.company=c.id
where s.trans_type='SALE' and s.user_id=userId;

SELECT 
sum((s.net_amount - (select (st.net_amount / st.stock_in) * s.out_stock  buy_net_amount from stock_ledger st  where st.trans_type !='SALE' and st.lot_number= s.lot_number))) into currentMonthEarnings
 FROM stock_ledger s 
inner join  companies c ON s.company=c.id
where s.trans_type='SALE'  and s.user_id=userId and DATE_FORMAT(s.trans_date,"%Y-%m") =DATE_FORMAT(current_date(),"%Y-%m") ;

SELECT 
sum((s.net_amount - (select (st.net_amount / st.stock_in) * s.out_stock  buy_net_amount from stock_ledger st  where st.trans_type !='SALE' and st.lot_number= s.lot_number))) into todayEarnings
 FROM stock_ledger s 
