  ifnull(sum(netAmount),0) as total_equity_holdings,
  ifnull(totalProfit,0) as total_earnings,
  ifnull(currentMonthEarnings,0) as current_month_earnings, 
  ifnull(todayEarnings,0) as today_earnings,
  0 as unrealize_net_worth
  from tNameStep3 ;
  
  
  
  
  

  
